INSERT INTO dt_question_result VALUES
(1, 1, 'BAB', '感性动物，更加在乎恋爱中双方的感受。\r\n对生活有着相同的感触，也许经历不同，但你们都知道物质才是生活的基础，没有面包的爱情也许不会幸福；\r\n爱情中，希望得到彼此更多的爱。\r\n也许你都经历过生活的坎坷，所以你们都希望有一个安安稳稳的未来生活，两个孩子一只狗，一个温馨的家是你们的归属。\r\n希望在细节上给与对方最大的关怀，从生活的点点滴滴去珍爱对方。\r\n属于爱情中的”奉献者“，期望对方比自己更快乐。\r\n对生活有着更长远的打算，也许当下苦一点，并不会对你们造成多少伤害，你们期许的是一个更好的未来。\r\n在日常生活中，都知道自己想要什么不想要什么，所以很少会冲动消费。\r\n对命运这种事情，有着难得一致的认同感，都认为有些感情早已安排妥当，只是静静的等待我们去发现。\r\n对人对事对物，都可以极大程度的包容，这使你们未来沟通起来会更加顺畅。', 75, 90, 80, 88),
(2, 2, 'AAA', '你们有着对幸福的相同定义，更愿意脚踏实地的去创造丰厚优质的生活；\r\n你们对生活有着相同的感触，也许经历不同，但你们都知道物质才是生活的基础，没有面包的爱情也许不会幸福；\r\n你们都对生活有着极致的追求，属于宁缺毋滥型。\r\n你们都认为人生短暂，不能把酒言欢的生活都是在浪费时间；\r\n你们对命运这种事情，有着难得一致的认同感，都认为有些感情早已安排妥当，只是静静的等待我们去发现。', 80, 85, 79, 85),
