INSERT INTO dt_trends VALUES
(1, 7, '其实有时候想想，一辈子要追求的东西太多了，而什么对我们最重要呢？我认为是健康。只有身体健健康了，我们才能全身心的去追求自己梦想的一切。', 13, 10, 3, 0, '2019-11-11 15:07:49', NULL, NULL, NULL),
(2, 7, '人生本来就是一件不容易的事情，不付出不努力什么都得不到。我们现在还年轻，有大把的机会和时间，好好奋斗吧，让未来的自己变得更好。', 1, 0, 1, 0, '2019-11-11 15:09:53', NULL, NULL, NULL),
(3, 7, '老婆给当程序员的老公打电话：“下班顺路买一斤包子带回来，如果看到卖西瓜的，买一个。”当晚，程序员老公手捧一个包子进了家门。老婆怒道：“你怎么就买了一个包子？！”老公答曰：“因为看到了卖西瓜的。”', 1, 0, 2, 0, '2019-11-11 15:19:12', NULL, NULL, NULL),
(4, 9, '某女：你能让论坛的人都吵起来，我今晚就跟你走。某软件工程师：PHP是最好的语言！某论坛炸锅了，各种吵架...。某女：服了你了，我们走吧，你想干啥都行。某软件工程师：今天不行，我一定要说服他们，PHP是最好的语言。', 1, 4, 2, 0, '2019-11-11 15:22:19', NULL, NULL, NULL),
(5, 9, '两程序员向同一个MM求爱，MM说：“去环游世界后再来找我！”码农A立即收拾行李出发。码农B绕MM一圈，然后说：“Hello world！”立即感动了MM。其实他只是习惯在做任何新事情前先确定Hello World能跑通而已。', 1, 1, 1, 0, '2019-11-11 15:26:11', NULL, NULL, NULL),
(6, 12, '你愿意尊重她，帮助她，关怀她，爱她一生一世吗？”，被问到这个问题的时候，程序员新郎有点慌，因为这个场景太熟悉了，又是需求还没明确好就把排期给定好了。', 1, 0, 1, 0, '2019-11-11 15:26:42', NULL, NULL, NULL),
(7, 8, '“我爱你”三个字，讲出来只要三秒钟，解释要三小时，证明却要一辈子。“bug”三个字母，发现需要三秒，找到需要三小时，debug却要一辈子。', 2, 1, 2, 0, '2019-11-11 15:27:53', NULL, NULL, NULL),
(8, 19, '洛阳亲友如相问，就说我在敲代码。', 1, 2, 1, 0, '2019-11-11 15:28:31', NULL, NULL, NULL),
(16, 8, '洛阳亲友如相问，就说我在敲代码呀呀呀', 2, 1, 1, 0, '2019-12-06 12:34:07', 112.00000, 23.00000, '广州'),
